import s from "./download.module.css";
import firefox from "../../images/svg/logo-firefox.svg";
import chrome from "../../images/svg/logo-chrome.svg";
import opera from "../../images/svg/logo-opera.svg";

export const Download = () => {
  const data = [
    {
      img: chrome,
      title: "Add to Chrome",
      ver: "Minimum version 62",
    },
    {
      img: firefox,
      title: "Add to Firefox",
      ver: "Minimum version 55",
    },
    {
      img: opera,
      title: "Add to Opera",
      ver: "Minimum version 46",
    },
  ];

  return (
    <div>
      <h2 className={s.title}>Download the extension</h2>
      <p className={s.desc}>
        We`ve got more browsers in the pipeline. Please do let us know if you`ve
        got a favourite you`d like us to prioritize
      </p>
    </div>
  );
};
